import React from 'react';
import { Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle, Button } from 'reactstrap';
import kebap from '../../public/images/kebap-karisik.jpeg';

const Buffet = (props) => {
  return (
    <div>
      <Card>
        <CardImg top width="100%" src={kebap} alt="Kebap" />
        <CardBody>
          <CardTitle>BUFFET</CardTitle>
          <CardSubtitle>Buffet Menu</CardSubtitle>
          <CardText>Please click to see more details and the menus.</CardText>
          <Button>More-></Button>
        </CardBody>
      </Card>
    </div>
  );
};

export default Buffet;
